import * as React from 'react';
import './footer.css';

export class Footer extends React.Component{
    render() {
        return (
            <div className="container-fluid" id="footer-section">
                <h2>Vamos conversar?</h2>
                <p>Venha conversar com a gente, estamos aqui para ajudar você a fazer parte do ecossistema de empreendedorismo na Universidade
                de São Paulo.</p>
                <h5>Localização:</h5>
                <p>InovaLab@Poli<br/>Av. Luciano Gualberto, 1380<br/>Cidade Universitária, São Paulo-SP<br/>Prédio da Engenharia de Produção - Poli USP</p>
            </div>
        )
    }
}
